"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.default=void 0;var i=[{id:0,name:"Ириг",position:[45.10537570381998,19.858075811519857],icon:"city_icon",image:"irig",desc:'Ириг је градско насеље у општини Ириг, у Сремском округу, у Србији. Према попису из 2011. било је 4.415 становника.Лежи на веома важној саобраћајници која полази од Новог Сада и преко Иришког венца, и средњим делом јужних обронака Фрушке горе спушта се до Руме. Познат воћарско-виноградарски рејон, са великим винским подрумом.Ириг је у 19. веку прометно место, трговиште у Срему.\nОвде се налазе три православна храма посвећени Светом Николи, Светом Теодору Тирону и Успењу Богородице и римокатоличка црква. Године 1753. у Иригу је отворена прва основна школа. Учили су се у њој језици: немачки, латински и славјаносербски. Први учитељ је био Михајло Владисављевић. Пописане су 1811. године у месту три школе са по 28, 100 и 112 ђака. Митрополит дабробосански Георгије Николајевић је у младости био учитељ у Иригу.\nГодине 1934. у иришком тада новом градском парку био је постављен споменик српском краљу Петру I Карађорђевићу Ослободиоцу. Споменик су подигли својим прилозима грађани, а он је дело руку вајара Јовановића из Сремске Митровице. Ирижани су на оближњем брегу на Фрушкој гори тада поставили и "клупу краља Александра", у спомен на његову посету Иригу 1919. године.\nПрво "Читалиште у Срба" основано је 1842. године у Иригу, у српској школи. Иницијатор је био игуман архимандрит крушедолски Димитрије Крестић. Земунски издавач и књижевник Григорије Возаревић је тада поклонио Српској читаоници у Иригу књигу Доситеја Обрадовића, "Писма" штампану 1833. године.'},{id:1,name:"Врдник",position:[45.12595979385059,19.79230753835482],icon:"city_icon",image:"vrdnik",desc:"Врдник је насеље у Србији у општини Ириг у Сремском округу, на јужној страни Фрушке горе.\nВрдник се први пут помиње 1315. као тврђава Врдник, а други пут тек 1702. године, кад се наводи као насељено место које је имало физиономска обележја карактеристична за већину фрушкогорских насеља. Дуго се развијао уз истоимени манастир, а већинско становништво чинили су досељеници са свих страна, који су представљали најамну радну снагу (кметови – прњаворци) на имањима манастира. За развој Врдника од највеће важности било је откривање налазишта мрког угља и почетак његове експлоатације. Рудник је отворен 1804. као један од најстаријих на подручју бивше Југославије и први у Србији. Експлоатација је трајала до 1965. а затворен је 1968. године.\nУ Врднику је поред пољопривреде развијена индустрија и туризам. Такође постоји реална могућност реактивирања рударства које је усахнуло 1968. год. Туризам је свакако најмлађа и најпреспективнија привредна грана Врдника а и околине.\nЗа Врдник су посебно значајне термоминералне воде. Посебно се издваја извор киселе и извор термалне воде. Извор киселе минералне воде налази се у долини врдничког потока. Овај извор је откривен 1953. године и давао је око 50 литара воде на минуту, температуре 15,5°C.Други извор термалне воде појавио се када је вода поплавила јужно окно рудника мрког угља у Врднику. Вода је класификована као натријум-магнезијум-хидрокарбонатно-сулфидна хомеотерма. Температура воде је 32,8°C, и успешно се примењује код лечења реуматизма, за постоперативну рехабилитацију и друго.\nБања се налази у изванредном природном амфитеатру, окружен благим поточним долинама, обраслим бујном и разноликом вегетацијом. Пружа изванредне могућности за лечење, одмор и рекреацију, као и туризам, с обзиром на бројне културно историјске споменике у непосредној близини. Бања поседује отворене и затворене базене, сауне и др. који пружају услове за рекреацију, релаксацију како онима који долазе на лечење тако и гостима који долазе на одмор."},{id:2,name:"Манастир Врдничка Раваница",position:[45.12845438970892,19.7842513789861],icon:"church",image:"manastir_ravanica",desc:'Манастир Врдник, познат и као Мала Раваница, један је од најзначајнијих манастира на Фрушкој гори. Године 1811, на Видовдан, када је завршена манастирска црква, у њу су пренете мошти светог кнеза Лазара.\nКао и код већине фрушкогорских манастира прошлост манастира Раваница у Врднику остаје нејасна. Први податак о њему долази из турских докумената где се у попису из 1566. године наводи његово имање и одређује сума од 3000 акчи за његов откуп. Монаси из манастира нису успели да сакупе потребну своту па су се, плашећи се турске освете, разбежали на све стране. На сву срећу појавио се један мештанин Купиника (Купинова) по имену Пејо који је исплатио Турцима тражени износ.У то време манастир је био сиромашан, па су врднички монаси често путовали у Русију тражећи материјалну помоћ. Ипак, временом, највише захваљујући томе што су у њему биле смештене мошти кнеза Лазара, манастир је примао све више посетилаца, а и новчана помоћ је била све већа.\nРаваничка нова црква од чврстог материјала грађена је за време митрополита Стефана Стратимировића између 1801. године (када су освећени темељи) и 1811. године (када је освећена готова богомоља). Претходно је готово век скупљан новац за његово подизање, а заузимали су се највише постриженици тог манастира. Између осталих један од њих костајнички владика Јосиф Стојановић је основао фонд за зидање нове цркве у износу 3.348 форинти. Освећење је уприличено о Видовдану те 1811. године за време архимандрита Гедеона Петровића. Тада су свечано пренете свете мошти "светог цара Лазара", из старе у нову цркву.\nВрднички манастир је у сваком погледу изузетно вредан и представља један од најкапиталнијих на Фрушкој гори. Он је дуго био и међу најбогатијим на Фрушкој гори — 1905. године поседује 1696 јутара земље, а 1941. године укупно 1420 јутара. Осим комада моштију кнеза Лазара, манастир поседује још и мошти свете великомученице Анастасије (III век), светиње са Христовог гроба, део моштију св. Теодора Тирона (све изложено испред иконостаса). Врднички манастир је у сваком погледу изузетно вредан и представља један од најкапиталнијих на Фрушкој гори. Слава манастира Раваница је Видовдан — 28. (15.-по старом календару) јуна. У дворишту манастира, од пролећа 1912. године налази се биста Милице Стојадиновић Српкиње, рад вајара Јована Пешића. Духовник манастира је јеромонах Пајсије Будимир.'},{id:3,name:"Ривица",position:[45.09541109191194,19.829897221264268],icon:"city_icon",image:"rivica",desc:"Ривица је насеље у Србији у општини Ириг у Сремском округу смештено у западном делу иришке општине. Први пут се помиње 1284. године, а као насеље 1702. године. Према попису из 2011. било је 620 становника. У центру насеља налази се православна црква, једна од најстаријих у Срему. Од 1995. године у овом селу се одржавају „Дани бостана“. Од 2002. се одржавају Дани вина у Ривици. Овде се налазе Воденица у Ривици, Црква Светог великомученика Георгија у Ривици и Црква Светог пророка Илије у Ривици.\nУ насељу Ривица живи 535 пунолетних становника, а просечна старост становништва износи 43,2 година (40,9 код мушкараца и 45,5 код жена). У насељу има 224 домаћинства, а просечан број чланова по домаћинству је 2,93. Ово насеље је углавном насељено Србима (према попису из 2002. године)."},{id:4,name:"Јазак",position:[45.108303184709726,19.764087824820464],icon:"city_icon",image:"jazak",desc:"Јазак је насеље у Србији у општини Ириг у Сремском округу. Према попису из 2011. било је 960 становника. Овде се налази Српска православна црква Светог Николе у Јазаку.\n У насељу Јазак живи 897 пунолетних становника, а просечна старост становништва износи 43,2 година (41,9 код мушкараца и 44,4 код жена). У насељу има 386 домаћинстава, а просечан број чланова по домаћинству је 2,83. Ово насеље је великим делом насељено Србима (према попису из 2002. године)."},{id:5,name:"Манастир Јазак",position:[45.11890611667614,19.765386192407846],icon:"church",image:"manastir_jazak",desc:"Манастир Јазак припада Епархији сремској Српске православне цркве који се налази на Фрушкој гори. Представља непокретно културно добро као споменик културе од изузетног значаја.\nИзграђен је 1736. године на равном завршетку мале котлине, између два пропланка, на јужној падини Фрушке горе, на потезу познатом под именом Градац. Манастирски комплекс се састоји од цркве са звоником, окруженој са три стране конацима, док је са четврте стране зид и засвођени улаз у манастирску порту. У средини порте је манастирска црква са троспратне звоником.Непосредно уз манастир, на путу према селу Јазак, налази се манастирски прњавор, а на удаљености око два километра, северно од манастира, налазе се остаци манастира Стари Јазак, који је према предању, основао је св. Деспот Јован Бранковић, млађи син св. Стефана Слепог и св. Мајке Ангелине. Био је посвећен Ваведењу Пресвете Богородице (21. новембар/ 4. децембар). Први писани податак потиче из 1522. године. Помиње се у рукописном Триоду који је преписивао јазачки монах Лаврентије.\nС обзиром да из 17. века нису сачувана сведочанства о манастиру, претпоставља да је запустео све до Велике сеобе Срба 1690. године. Тако су 1705. пренете мошти цара Уроша из Неродимља, због чега је манастир уживао велики углед. У време митрополита Вићентија Јовановића 1736. године, донета је одлука о изградњи нове Цркве Св. Тројице у барокном стилу, коју је јуна 1758. освештао митрополит Павле Ненадовић и у њу је пренет инвентар старог манастира.Пошто је унутрашњост цркве дуго стајала само окречена, 1899. године сликар Павле Чортановић (1830-1903) је урадио уљане зидне слике с појединим ликовима из националног и опште хришћанског светитељског пантеона.\nУ аграрној реформи након Првог светског рата, манастир је остао без 250 јутара земље, која је враћена 1928, запуштена. Вођење бриге о манастирском имању је са успехом преузела гца Темира Поповић, по уговору са настојатељем Валеријаном Прибићевићем. Највећи и најдетаљнији радови на манастирском комплексу урађени су у периоду од 1926—1930. године. Током Другог светског рата манастир је претрпео велику штету. Тадашњи директор загребачког Музеја за уметност и обрт, Владимир Ткалчић тада је однео 79 предмета. Партизани су га запалили у лето 1942, када је изгорео део зграде, Немци узимали грађу од остатака, а службеник НДХ Антон Бауер однео остатак вредних предмета из манастира. После рата манастир је обновљен. Приликом последње обнове, у западном крилу конака смештене су библиотека, свечана трпезарија и ризница."},{id:6,name:"Мала Ремета",position:[45.101487935458756,19.74654082599323],icon:"city_icon",image:"mala_remeta",desc:"Мала Ремета је насеље у Србији у општини Ириг у Сремском округу. Смештено је на надморској висини 250-260 м. Спада у групу виших насеља фрушкогорске области. Село 1991. године има 157 становника, од којих су преко четири петине досељеници из Босне. Према попису из 2011. било је 130 становника. Село се формирало уз истоимени манастир, који је изграђен у периоду од 1545. до 1548. године. У селу се налази етно ресторан Лугарница.\nУ насељу Мала Ремета живи 120 пунолетних становника, а просечна старост становништва износи 42,5 година (42,4 код мушкараца и 42,5 код жена). У насељу има 53 домаћинства, а просечан број чланова по домаћинству је 2,79. Ово насеље је великим делом насељено Србима (према попису из 2002. године)."},{id:7,name:"Манастир Мала Ремета",position:[45.11019609120527,19.74328832973292],icon:"church",image:"manastir_mala_remeta",desc:'Манастир Мала Ремета или Реметица припада Епархији сремској Српске православне цркве који се налази на Фрушкој гори, поред истоименог села. Представља непокретно културно добро као споменик културе од изузетног значаја.\nНалази се на јужном средишњем делу Фрушке горе, уз манастирски прњавор село Мала Ремета. Име манастира значи Мала пустиња.\nМанастирска црква је посвећена Богородичином покрову. Традиција оснивање манастира везује за српског краља Драгутина. У протоколу манастира Беочина, наводи се 1844. године да је манастир Мала Ремета „стар 601 годину”, а што би могло да значи — 1243. године. Кратку историју манастира Мала Ремета, написао је 23. новембра 1738. године хоповски игуман Иринеј Радић, у манастиру Беочину. Поуздане податке пружају једино турски документи, у којима је манастир први пут забележен 1546, али је врло брзо после тога спаљен. Крајем 17. века манастир су обновили избегли монаси Манастира Рача на Дрини. Из тога времена потиче и манастирски печат и од тада, па до 1920. године манастир се води као метох Манастира Беочин. На месту старе цркве, саграђена је нова, трећа по реду грађевина 1739. године.\nМанастирску цркву су сазидали (по контракту из 1738.) на "грунту беочинском" мајстори Тодор и Никола, а ктитор је био Станко Милинковић[1] из Шуљма[4]. Из исте године потиче заштитна повеља издата од генерала Валиса Манастиру Беочин у којој се помиње и штити Мала Ремета. Јован Јовановић оберлајтант Петроварадинске регименте је манастирску цркву изнутра репарирао[2], као и са северне стране испод ћелија од камена, подрум саградио 1754. године. Поручникова удова Ружица је подигла по вољи покојниковој још три монашке ћелије са малом кухињом у средини. На челу манастира је од 1749. године игуман Атанасије. Престоне иконе за ову цркву радио је иконописац Јанко Халкозовић 1759. године.\nГодине 1845. јеромонах и надзиратељ манастира био је Венимијан Бороцки. У Другом светском рату страдао је конак као и манастирска библиотека.\nДанас манастир чине црква, једнокрилни конак, нови дрвени звоник и капела.\nУ манастиру су написане и чувају се две вредне рукописне књиге из XVII века.'},{id:8,name:"Нерадин",position:[45.12124243838526,19.896658925518143],icon:"city_icon",image:"neradin",desc:'Нерадин је насеље у Србији у општини Ириг у Сремском округу, на јужним падинама Фрушке горе, у источном делу иришке општине. Од Ирига је удаљено 6 km. Налази се на надморској висини од 184 m. Према попису из 2011. било је 475 становника (према попису из 1991. било је 625 становника), а основна привредна грана је пољопривреда, нарочито ратарство за које постоје најбољи услови. Нерадин је једно од старијих насеља у иришкој општини. Село се помиње први пут 1247. године. У селу се налази православна црква посвећена Светом Николи која је саграђена 1734. године. Ова црква је под заштитом државе као споменик културе од великог значаја. Овде се налази Перков Салаш.\nГодине 1727. Марија кћерка Хаџи Комнена Георгијевића је у Будиму званично писмом на немачком језику тражила од државе "милост за себе и своју породицу". Позивала се она на су њени преци као и отац, били заслужни за Аустрију. Цареви, Фердинад III а касније и Леополд I су им дали племство и поседе у Срему, међу којима и спахилук Нерадин. Селом Нерадин су током 18-19. века (од 1691) господарили калуђери манастира Гргетега. Ту се на месту званом "Грабовац" налазио њихов "мајдан кречног камена", из којег се црпео и продавао квалитетан креч. Сваке године духовници су издавали манастирску крчму и земљу у аренду. Приход од Нерадина и пустаре Банковци износио је 5.000 ф. годишње. Купили су 1831. године једну српску поучну књигу, бројни писмени угледни мештани: поп Василије Попадић, кнез нерадински Евтимије Бизумић, учитељ Петар Петровић, арендатор Николај Димитријевић, црквени тутор Нестор Кунић, црквени појац Аксентије Стојановић, адвокат и куратор манастирског добра у Нерадину Јован Поповски, те три земљеделца Јован Јовановић, Гаврил Јевтић и Григорије Живковић - за њихову децу.\nУ насељу Нерадин живи 456 пунолетних становника, а просечна старост становништва износи 42,8 година (42,5 код мушкараца и 43,1 код жена). У насељу има 171 домаћинство, а просечан број чланова по домаћинству је 3,22. Ово насеље је великим делом насељено Србима (према попису из 2002. године).'},{id:9,name:"Гргетег",position:[45.13486436149287,19.89334444444853],icon:"city_icon",image:"grgeteg",desc:"Гргетег је насеље у Србији у општини Ириг у Сремском округу. Према попису из 2011. било је 76 становника. Саграђено је јужно од истоименог манастира, који је основан 1471. године и који је на 274 метара надморске висине. Гргетег је село планинског типа.\nУ насељу Гргетек живи 76 пунолетних становника, а просечна старост становништва износи 49,4 година (45,5 код мушкараца и 53,2 код жена). У насељу има 25 домаћинстава, а просечан број чланова по домаћинству је 2,80. Ово насеље је у потпуности насељено Србима (према попису из 2002. године)."},{id:10,name:"Манастир Гргетег",position:[45.13900306355354,19.90181381476695],icon:"church",image:"manastir_grgeteg",desc:'Манастир Гргетег припада Епархији сремског Српске православне цркве и представља непокретно културно добро као споменик културе од изузетног значаја.\nМанастир се налази на јужном обронку Фрушке горе у непосредној близини насеља Гргетег бившег манастирског прњавора. Манастирска црква посвећена је св. Николи. Према народном предању основао га је деспот Змај Огњени Вук 1471. године и доделио име по свом оцу Гргуру. На припрати црквеној је накнадно исписано: Вук деспот основатељ сеје св. обитељи Гргетега љета 1471.\nКрајем 17. века манастир је напуштен, а 1708. године обнавља га митрополит Исаија Ђаковић. Претходно је аустријски цар Леополд I је 1691. године, даровао Гргетег - тада у рушевинама (са Нерадином и Банковцима) као властелинско добро владики Ђаковићу, који је тада седео у "Арадско-Јенопољској столици". Када је Исаија изабран за архиепископа и митрополита српског замолио је цара, да Гргетег не остане као наследан Арадско-јенопољској дијецези, већ да припадне српској Митрополији. Када је Гргетег прешао на митрополију мудри Ђаковић га оправља и подиже монашке ћелије. До 1749. године манастир Гргетег је називан "Митрополијски". Сачуване су владарске привилегије дате од царева Леополда I и Јосифа.\nВизитација манастира Гргетега извршена је 21 јула 1753. године, од стране Арсенија Радивојевића. До тада су манастир као ктитори оправљали митрополит Исаија Ђаковић и ахимандрит и митрополит Вићентије Поповић. На часној трпези налазио се тада "полован" антиминс, који је освећен 1722. године у Хопову. Темпло је био рад "мајсторије српске". У дрвеном ћивоту намештеном у левој певници чуване су свете мошти: стопало првомученице Текле, кост лобање првомученика архиђакона Стефана. Засебно су у дрвеној кутији ту положени: кост великомученика Св. Георгија и "новијег" српског светитеља Јована "мученог у Београду".[4] На старом епитрахиљу била је извезена година 1553. У ризници су се налазили и сасуди и утвари (у два дрвена сандука) склоњени 1739. године из манастира Сланци, код Београда. Такође ту је неколико икона склоњено из придворне капеле Београдске, из исте ратне године. Било је неколико монашких ћелија, поред две кухиње и веће трпезарије као и других здања, који су подигнути 1751-1752. године. Манастирско имање чиниле су још две воденице, салаш код села Шатринци, пустуру Банковци, "господство" над селом Нерадин, те много стоке, пчелињак, оранице, винограде и воћњаке. Било је ту стално много посла са бројне манастирске слуге и надничаре из прњавора и околине.\nУ Нерадину селу које је припадало манастиру и давало приход, налазили су се кречни мајдан за производњу креча, земља и крчма. Братство манастирско је сваке године преко новина продавало "нерадински креч" и издавало крчму на годину дана. Бригу о том издвојеном добру водио је 1831. године у Нерадину, адвокат Јован Поповски. Арендатор тамошњег добра у исто време био је Николај Димитријевић. Код манастира Гргетега налазила се Калинова водица. Позната је у Аустрији и Чешкој гргетешка ракија манастирска шљивовица, која се тамо и извозила због квалитета.\nМитрополит Павле Ненадовић је 1750. године почео да гради у Гргетегу нову зграду. Иста је завршена 1763. године. Ненадовић се увек потписивао уз друге титуле, наводећи и "архимандрит манастира Гргетега". Мада је након изградње и осликавања новог храма, Гргетег био "најлепши манастир на Фрушкој Гори" био је "у опасности" да буде укинут 1777. године. Царском вољом те године је заиста решено да се због редукције православних манастира, укида манастир а сво његово "добро" даје митрополиту Вићентију Јовановићу. Митрополит је дуго одлагао извршење те неправедне одлуке док му није по трећи пут строго наложено да изврши. Када су се калуђери иселили остао је манастир годину дана пуст. Тада се православни народ побунио и чак "роптао" на митрополита мислећи да је и он за то крив. Митрополит је кажу са сузама у очима преклињао царицу Марију Терезију да укине решење о укидању. На крају је и успео а царица је оставила да Гргетег буде манастир, али само из особите милости и ради утехе народа српског. Дана 10. јуна 1778. године започео је "нови живот" манастира Гргетега; тада су на свечаности поново званично уведени гргетешки калуђери под свој кров.\nГодине 1865. Гргетегу који спада у "Архимандрије" (са архимандритима) је подређена филијала Ремета. "Српска манастирска штампарија" у Новом Саду је 1893. године постала - добила нове власнике - манастире Гргетег и Беочин. Ти манастири су купили једну штампарију тада у Новом Саду, која је у граду и остала али да би од тада радила за црквене потребе.'},{id:11,name:"Шатринци",position:[45.06578297501957,19.92070547712004],icon:"city_icon",image:"satrinci",desc:"Шатринци (мађ. Satrinca) су насеље у југоисточном делу иришке општине у Сремском округу. Шатринци су ушорено насеље панонског типа, типично војвођанско село. Основна привредна функција насеља је пољопривреда. Шатринци су типично пољопривредно село. Према попису из 2011. било је 373 становника.\nШатринци су старо средњовековно село, које се наводи у грамати издатој у Берксову 4. маја 1496. године. Српски деспот Јован Бранковић је тада 16 својих у Срему лежећих села међу којима и Шатринце, подарио скоро основаном српском православном манастиру Крушедолу. Међу старим подацима о селу је онај из 1702. године, који говори да су Шатринци чисто српско село. Али село је настало много пре велике Сеобе Срба. Код Шатринаца је манастир Гргетег 1753. године имао салаш са стоком и воденицу. Шатринци имају две цркве, православну и католичку, лоциране у истом дворишту, једна поред друге. Православна је подигнута 1761. године. На месту порушене старе цркве подигунта је нова 1857. Римокатоличка црква изграђена је 1850. године. Број становника током 19. века. Године 1815. ту живи 100 католика и 98 православаца. А 1869. године, број католика се удвостручио - 220, православних је нешто више - 119 душа и има четири Јевреја.\nУ насељу Шатринци живи 305 пунолетних становника, а просечна старост становништва износи 37,4 година (36,8 код мушкараца и 38,1 код жена). У насељу има 140 домаћинстава, а просечан број чланова по домаћинству је 2,85. Становништво у овом насељу је мешовито уз мађарску већину."},{id:12,name:"Крушедол",position:[45.12507915843549,19.934767732233016],icon:"city_icon",image:"krusedol",desc:"Крушедол је насеље у Србији у општини Ириг у Сремском округу. Према попису из 2011. било је 340 становника.\nТо је сремско насеље које се састоји од Крушедол Села и Крушедол Прњавора. Налази се на јужним падинама Фрушке горе, у иришкој општини. Године 1991., Крушедол Село је имало 372, а Крушедол Прњавор 229 становника.\nУ Крушедол Селу живи претежно староседелачко сремско становништво. Село је настало крајем 15. века. Овде постоји релативно стара црква, Сретењска црква, која је била манастирска црква некадашње задужбине и женског манастира који је основала деспотица Ангелина Бранковић из 1512-1516. године, где је она живела и умрла.\nУ насељу Крушедол Село живи 306 пунолетних становника, а просечна старост становништва износи 43,7 година (41,7 код мушкараца и 45,7 код жена). У насељу има 147 домаћинстава, а просечан број чланова по домаћинству је 2,64. Ово насеље је великим делом насељено Србима (према попису из 2002. године)."},{id:13,name:"Манастир Крушедол",position:[45.1236938696846,19.944304057535625],icon:"church",image:"manastir_krusedol",desc:'Манастир Крушедол припада Епархији сремској Српске православне цркве и представља непокретно културно добро као споменик културе од изузетног значаја. Налази се на југоисточним обронцима Фрушке горе у Војводини.\nСам манастир се налази у атару села Крушедол, на путу између сремског градића Ириг и села Марадик. Манастир је задужбина породице последњих српских деспота у Срему - Бранковића. Крушедол се састоји од две целине, мушког манастира са црквом посвећеном Благовестима који је основао владика Максим Бранковић и женског манастира са црквом посвећеном Сретењу, који је подигла његова мајка, замонашена деспотица Ангелина.\nВладика Максим започиње изградњу манастира Крушедол који постаје седиште Београдско-сремске митрополије. Саграђени су манастирска црква посвећена Благовештењу и конаци на земљишту српског деспота Јована Бранковића између 1509. и 1521. године. Претходно је деспот Јован у Беркасову издао даровну грамату 4. маја 1496. године. У њој је навео да 16 својих у Срему лежећих села даје манастиру Крушедолу. Породица Ђорђа Бранковића, два патријарха Српске православне цркве и краљ Милан Обреновић су сахрањени у Крушедолу.\nНедалеко од манастира Крушедола, мајка Ангелина је подигла цркву и женски манастир у којем је и сама живела. Та црква је касније постала парохијска црква села Крушедола.Средином 17. века манастир има импозантан број калуђера. Било их је по сведочењу владике Мелентијевића (1723) тада - 90 калуђера и 12 стараца који су живели у "киновијској заједници". Приликом повлачења Турака из Срема 1716, манастирски конаци су оштећени, а црква спаљена. Било је то током опсаде Петроварадина, као и након турског пораза.\nОбнављање манастира је почело 1721. године и завршено крајем шесте деценије 18. века. Митрополит Вићентије Поповић је направио општу кухињу, трпезарију, подрум.\nУ цркви, испред иконостаса, налазе се кивоти у којима су смештени остаци моштију светих Бранковића, тј. деспота Ђорђа Бранковића и његових родитеља, Ангелине и слепог Стефана Бранковића. Ти кивоти су направљени и обојени 1759. године захваљујући новосадском бирову Давиду Рацковићу. У припрати са десне стране налазила се зидана гробница Св. Максима (1838).У манастирској цркви, у припрати леже и посмртни остаци многобројних значајних Срба. Између осталих ту су сахрањени: патријарх Арсеније III Чарнојевић (1706), митрополит Исаија Ђаковић (1708), патријарх Арсеније IV Јовановић Шакабента (1748), митрополит Викентије Поповић (1725), гроф Ђорђе Бранковић (ту од 1744), пуковник граничарски Атанасије Рашковић (умро 1753), војвода Стеван Шупљикац (1848), књегиња Љубица Обреновић и краљ Милан Обреновић.\nПо историјско-културној улози, по богатству ризнице манастира, чувеном иконостасу и живопису, другим реликвијама, манастир Крушедол је један од најзначајнијих Фрушкогорских манастира. Ту су се половином 19. века чувале повеље - хрисовуља Молдавског војводе из 1642. године (на влашком језику), затим она коју су 1685. године дали руски цареви Јован и Петар Алексијевић (на руском), те ону издату од стране војводе Каравлахијског 1707. године. У ризници је било и рукописно јеванђеље, које је написао 1514. године јеромонах Панкратије.'},{id:14,name:"Велика Ремета",position:[45.15139325329317,19.9204632442791],icon:"city_icon",image:"velika_remeta",desc:"Велика Ремета је насеље у Србији у општини Ириг у Сремском округу. Једно је од највиших насеља на Фрушкој гори. Налази се на надморској висини од 240-290 m. У Великој Ремети се налази истоимени манастир посвећен светом Димитрију. Овде се налази Извор Убавац.\nУ насељу Велика Ремета живи 37 пунолетних становника, а просечна старост становништва износи 52,1 година (46,6 код мушкараца и 56,3 код жена). У насељу има 16 домаћинстава, а просечан број чланова по домаћинству је 2,19. Ово насеље је великим делом насељено Србима (према попису из 2002. године)."},{id:15,name:"Манастир Велика Ремета",position:[45.14209567487676,19.920743724435063],icon:"church",image:"manastir_velika_remeta",desc:"Манастир Велика Ремета је један најстаријих од 16 фрушкогорских манастира. Налази се у источном делу Фрушке горе, северозападно од истоименог насеља и некадашњег прњавора Велика Ремета, у чијем се атару данас налази. Манастир просторно и административно припада општини Ириг. Манастир је посвећен светом Димитрију, а у његовом саставу се налази и црква посвећена овом свецу. У оквиру манастира се налазе и две капеле — светог Јована Крститеља из 18. века и Успенија Пресвете Богородице из 1970.\nМанастир Велика Ремета налази се на јужној страни Фрушке горе, дубоко у планини и на висини од 270 m. Удаљен је свега 5-6 km од пута Београд-Нови Сад, па је лако доступан верницима и другим посетиоцима.\nПо предању, основао га је краљ Стефан Драгутин, када је у лову пао са коња и остао трајно хром и предао власт свом брату Милутину. Није извесно време када је манастир настао, претпоставља је у питању 15. век. Постоји један писани податак из 1509. да је изасланик-калуђер деспотице Ангелине Бранковић долазио у манастир посвећен светом Димитрију (манастир Велика Ремета је посвећен овом светитељу). Први помен манастира је из 1543. године у ферману султана Сулејмана I, којим су регулисани земљишни односи између манастира и суседних спахија. У званичним изворима Велика Ремета се под тим именом јавља први пут 1562. године. Први писани помен о писању богослужбених књига у манастиру је из 1568. године.\nСматра се да је градња манастира започета још у 15. веку. Манастир је живописан у 16. веку и изнутра и споља. Остаци фресака се изнутра могу видети још само у олтарском делу и деловима апсида, а споља у ниши изнад северних врата и на јужној страни. Времену осликавања иконостаса припадају горње партије зидова и свод, као и већина конака који окружују цркву, изведених комбинацијом камена и опеке у духу барока и доприносе изгледу утврђења. Архитектура манастира сведочи о традицији средњег века. У основи манастирска црква је крстобразна, има правоугаоне певничке испаде и изнутра полукружну апсиду која је споља тространа.\nМанастир је доста страдао 1716. приликом повлачења Турака и тада је изгорео један део библиотеке и манастирски архив. Познато је да је обнова од Турака порушених конака започела 1720. године када је братство започело да прибавља грађу. Као ктитор манастира 1722. године јавља се архиепископ Викентије Поповић, чијом заслугом су на северној страни сазидане три ћелије, две кухиње и засведене подрумске просторије испод њих. Радови на обнови и подизању конака извођени су и током 1724. и 1732. године, а у коначно су довршени између 1764. и 1771. године.\nНа почетку Другог светског рата, након пада Краљевине Југославије и њене окупације од стране Немаца и њихових сарадника, манастир Велика Ремета, као и читав Срем, потпали су под управу квислиншке Независне државе Хрватске (НДХ). Српски православни манастири су се нашли на удару војних власти претрпевши велико разарање и пљачку. Таква судбина је посебно погодила Велику Ремету, која је темељно опљачкана, а затим разрушена.У манастир су ушле усташке јединице и у њему остале све до пролећа 1943, тако да када је комисија загребачког Музеја за умјетност и обрт 10. септембра 1941, на челу са Владимиром Ткалчићем дошла да попише имовину манастира и да је однесе у Загреб, добар део манастирских драгоцености већ био покраден или уништен.Комисија је преузела свега око 60 предмета из цркве, ризнице и библиотеке, те два портрета из салона: руског цара Петра Великог и Андреје Андрејевића. Од књига је преузето неколико „србуља и рукописних дела“, док су манастирска архива и преостала добра била покрадена, уништена или су пропала. Када су пролећа 1943. усташе напуштале манастир, оне су га спалиле. Кубе и кров цркве су срушени, унутрашњост цркве је упропашћена (фреске су премазане), западно крило конака је сравњено са земљом, док су остали конаци претрпели велика оштећења.Драгоцености из манастира су чуване у Загребу све до 1946. године када је тамо отишла српска државноцрквена комисија, која је требало да изврши попис и преузимање културно-историјског блага које је у току Другог светског рата однесено из цркава и манастира Српске православне цркве са подручја НДХ.\nВелика Ремета је обновљена 1982. године у време архимадрита Данила Здравковића. После смрти оца Данила 2000.г . управу манастира прима архимадрит Стефан Вучковић. Слава манастира је Ивањдан - 7 (24) Јул. Манастир је данас у добром стању. Манастирски комплекс чине црква црква (католикон) посвећена светом Димитрију, капела светог Јована Крститеља из 18. века и капела |Успенија Пресвете Богородице из 1970. Манастир има највиши звоник у Срему (38,6 m) и са све четири стране је опкољен спратним конацима. Манастир поседује мали музеј старе српске музике, дело Димитрија Стефановића, музиколога и директора музиколошког института. У манастиру су сахрањени један од раних карловачких митрополита Стефан Метохијац."},{id:16,name:"Манастир Ново Хопово",position:[45.12802787976525,19.846339760911228],icon:"church",image:"manastir_novo_hopovo",desc:'Манастир Ново Хопово припада Епархији сремској Српске православне цркве и представља непокретно културно добро као споменик културе од изузетног значаја. Налази се на благој падини јужних обронака Фрушке горе, недалеко од Ирига. Удаљен је свега стотинак метара од магистралног пута Рума - Нови Сад, те је један од најприступачнијих фрушкогорских манастира. Манастир Ново Хопово, заједно са Крушедолом, по својој архитектури, просветној улози, историји богатој културним, верским и политичким догађајима, један је од најзначајнијих манастира у Србији, а посебно међу фрушкогорским манастирима.\nМанастир Ново Хопово, са црквом светог Николе по својој архитектонској вредности представља најзначајнију сакралну грађевину своје епохе на овим просторима. Први писани помен манастира је из 1451. године. По другом извору, подигао га је поново архиепископ српски Максим Бранковић и "именовао га (Хопово) и монахе ту сабрао" око 1490. године. Паралелно су постојала оба, суседна истоимена манастира, Ново и Старо Хопово. Само је Ново Хопово важнији, већи, богатији а 1753. године се каже да му је "Старо Хопово" (стари манастир) филијала, у којем нема властитих монаха, већ долазе по двојица из Новог Хопова. Калуђери су једном приликом чак прешли из Старог у Нови, манастир Хопово.\nСадашња црква подигнута је 1575-1576 године, а звоник са малом капелом на спрату посвећеној (преносу моштију) светом Стефану, озидан је 1751. године. Задужбина је више ктитора, Лацка и Марка Јовшића, те Јована Божанића и чланова његове породице, из Горњег (Српског) Ковина (место на острву Чепелу у Мађарској), ктиторски натпис на надвратнику западног портала бележи на првом месту. Саграђена је на месту првобитне цркве која је порушена. Молили су манастирски калуђери 1638-1639. године руског цара за помоћ манастиру "који се налази на српској земљи". Цар је одобрио да хоповски калуђери могу сваке 7-8 године по Русији да скупљају помоћ. Скупљао је 1641. године прилоге по руском царству хоповски проигуман Неофит. Вероватно од тог прилога 1641. године манастирске ћелије су стављене под кров. У Хопову је боравио од лета 1757. до јесени 1760. године млади Димитрије Обрадовић из Чакова, који се закалуђерио и добио ново име "Доситеј". Примио га је архимандрит Теодор Милутиновић хоповски игуман. Герасим Радосављевић произведен је 1771. године за архимандрита хоповског. Када је почетком 1788. ратне године од стране Турака спаљен манастир Каленић, избегли монаси игуманом Вукашиновићем су стигли у Срем. Провели су ту неколико година, са својим богатим инвентаром, до марта 1795. године, све у манастиру Хопову. Године 1855. на челу манастира налазио се архимандрит Севастијан Илић, настојатељ, врло образован човек, књижевни радник и члан неких европских пољопривредних друштава. Јеромонах Герасим Драшковић је био игуман 1809. године. Отворена је 1893. године монашка школа у Хопову, којом је управљао настојатељ манастира.\nНакон Првог светског рата манастир постаје женски, а у њега се насељавају 1921. године из руске калуђерице и избеглице. Оне су још 1915. године напустили свој православни манастир Љешну (у Пољској), али уместо у Русији, завршили су бежећи од Петрограда преко Бесарабије, у југословенској краљевини. Отворен је уз манастир прво Дечији дом за ратну сирочад, па интернат за руску децу (девојчице), а једини мушкарци су били (1932) духовник отац Нељубов (у том звању 25 година био) и администратор манастира отац Пајсије. Поменути Дечији дом је исељен 1921. године у манастир Кувеждин, а руске калуђерице су ту дошле са својим интернатом. Манастир је водила игуманија мати Нина Косаковска, након што је ту умрла прва игуманија мати Катарина Јефимовска (грофица!). Оне биле веома образоване и способне, те су спасиле - довеле 1920. године у Србију 60 калуђерица, и прво су годину дана провеле у манастиру Кувеждину. Руске калуђерице су са собом донеле чудотворну икону "Богородице Шумске", начињену од камена. Њу је пољском православном манастиру једном поклонио пољски краљ. Да не би била украдена, оригинална икона је чувана у депоу београдске Заложне банке (1932). Постојала је и мања икона - њена копија, која се чувала у хоповском храму. Манастир Хопово је више пута страдао током ратова у прошлости (1683, 1690, 1716). Последњи пут је то било током Другог светског рата (на Велики четвртак 1943) од стране партизана. Оштећен је звоник храма и уништена богата манастирска библиотека. Обновљени су коначно манастирска црква и конаци тек 1998. године. Мошти Св. Теодора су од 1943. па до 1984. године биле у Иригу, где су склоњене. Манастир Ново Хопово је у 21. веку остао отворен, остао је женски, а у њему су се налазе три монахиње. Сада је манастир опет мушки, а на челу братије се налази настојатељ архимандрит Павле Јовић.\nМанастирска ризница је почетком 20. века поседовала вредно књижно благо. Рукописне књиге сведочиле су о времену и манастирском братству. Најстарија богослужбена манастирска књига је "Панагерик". Написана је 13. маја 1555. године, од непознатог преписивача у време игумана Кир Стефана, духовника Аврама и еклесијарха Максима. Друга књига, "Минеј" преписана је тада - 1559. године. Књига Апостол је настала 1563. године, од руке ђака Станка, при игуману Кир Аврамију и еклесијарху Илариону. Књигу "Студит" са осам канона, преписао је хоповски монах Јефрем 1618. године, у време игумана Кир Евсевија. Једно рукописно "Јеванђеље" је оковано сребром 1630. године у време игумана Кир Стефана. "Канон Пресветој Богородици" написан је 1654. године. Друго "Јеванђеље" оковано је 1657. године при проигуману Неофиту.\nНајвеће богатство манастира су мошти светог Теодора Тирона које се чувају у кивоту, у цркви. У манастиру је 1780. године записана од стране јеромонаха Спиридона Јовановића, повест преноса светих моштију. Мошти великомученикове одавно у манастиру, јер се помињу ту већ 1555. године. По тој рукописној белешки, мошти светог Теодора су из цркве над гробом, коју је подигла побожна Евсевија, од стране неверујућих Јелина (Грка) избачене у море. Након три века, када је хришћанска вера победила, епископ града Евхаитског је мошти извадио из воде, и пренете су у цркву, која је по други пут подигнута над његовим гробом. После дугог времена, богати поклоници из Влашке су тајно узели мошти и однели их у Влашку, у град Сибињ. Богати тамошњи бољар је у својој кући, у једном чардаку, држао ковчег са моштима и клањао им се, а када је умро, оне су ту остале заборављене. Удова бољарева је након извесног времена, морала да поправи кровове и здања своја, па је ангажовала вештог дрводељу Србина из околине Јенопоља, Радована Ракића. Када је мајстор завршио посао, сањао је Св. Теодора који га је подсетио на себе и посаветовао у сну, да његове мошти одатле узме. Измолио је зато Радован удовицу, да му делом уместо новца уступи остатке свечеве. Када је мајстор узео мошти Св. Теодора Тирона, однео их је прво у свој крај, а потом у манастир. Првих 25 година мошти су лежале у манастиру Ходошу, и због њих су много болесници ту тражили исцелење. Како су се прочула чудесна излечења у Ходошу, Мађари са својим клиром, су хтели да силом узму мошти за себе. Да би избегли насиље, монаси су пребегли из Ходоша на Фрушку Гору, и свете мошти похранили у манастиру Хопову. Године 1747. заслугом игумана Захарија, уметнички резбарени ћивот од ораховине, платио је и поклонио манастиру да би се у њима чувале мошти, богати становник Бечеја Михаило Чокић.'},{id:17,name:"Манастир Старо Хопово",position:[45.135345488542015,19.858262811248004],icon:"church",image:"manastir_staro_hopovo",desc:'Манастир Старо Хопово је у сремској епархији Српске православне цркве. Смештен у источном делу Фрушке горе на 2 km удаљености од манастира Ново Хопово.\nОба истоимена, суседна манастира, Старо и Ново Хопово имају готово истоветну историју. Манастире је подигао исти ктитор Бранковић а манастирске цркве су дуго имале истог патрона. Оба манастира су на истом грунту и деле исте привилегије. С тим да је Старо Хопово увек мањи и сиромашнији манастир - називан и "манастирчић". Манастирска црква је првобитно била посвећена Св. Николи, а касније у 18. веку св. Пантелејмону. Према предању манастир је основао деспот Ђорђе Бранковић крајем 15. века, (1496-1502), а први запис о манастиру је из 1545-1546. године. Старо Хопово је 1753. године био филијала Новог Хопова или "Хопова", а њиме руководи новохоповски игуман.\nУместо старе дрвене цркве изграђена је 1752. године данашња зидана манастирска грађевина. Црква је патосана циглом а покривена храстовом шиндром. Било је то у време заслужног хоповског архимандрита Кир Захарија Миливојевића, дугогодишњег игумана. Он је дао да се промени патрон новог храма, да би се разликовао од Новог Хопова, а узео је за храмовног - свог "заветног заштитника" Пантелејмона. Од старе цркве је остала незаштићена часна трпеза, коју су морали или пренети у нови храм или закопати у земљу. Мошти Св. Теодора Тирона пренете су из Старог у Ново Хопово, где се и данас налазе. Претходно је игуман Захарије нашао бечејског поседника Михајла Чокића, да плати (513 форинти) израду уметнички израђеног ћивота од ораховине, у које су мошти 1747. године похрањене. У малој једнобродној цркви налазио се барокни иконостас велике вредности, на коме је престоне иконе сликао иришки иконописац самоук Јефрем Исајловић 1793. године. По неким нагађањима иконе је можда радио и иконописац Јанко Халкозовић. У Другом светском рату од стране усташа иконостас је оштећен и демонтиран, а манастирски конак разрушен. У току су припремни радови за обнову манастира, а у самом храму су урађени већ неки радови.\nПоново је манастир Старо Хопово оживео 2008. а отворен 2014. године. Седамдесет година је био напуштен (пред Други светски рат) па оштећен, у рушевинама. Остао је мушки, а манастиром руководи настојатељ протосинђел Атанасије Гатало, са монасима. У близини се налази капелица над старим извором потока Јеленца - Извор Старо Хопово.'},{id:18,name:"Добродол",position:[45.04437391308123,19.938168710976424],icon:"city_icon",image:"dobrodol",desc:"Добродол (мађ. Dobradó) је насеље у Србији у општини Ириг у Сремском округу. Према попису из 2011. било је 107 становника.\nУ насељу Добродол живи 90 пунолетних становника, а просечна старост становништва износи 36,3 година (34,8 код мушкараца и 38,1 код жена). У насељу има 42 домаћинства, а просечан број чланова по домаћинству је 3,02. Ово насеље је углавном насељено Мађарима (према попису из 2002. године)."},{id:19,name:"Врдничка кула",position:[45.14395733722716,19.775253240051224],icon:"fortress",image:"vrdnicka_kula",desc:"Врдничка кула (мађ. Rednak, Rednuk), као део некадашњег утврђеног града Врдника, се налази недалеко од Врдника,15km јужно од Новог Сада на Фрушкој гори. Први пут се у историјским изворима помиње 1315. године. Представља споменик културе од великог значаја.\nУтврђени град Врдник се налази на 400 метара надморске висине, на јужним падинама Фрушке горе. Град је имао издужену полукружну основу са улазном капијом на источном делу бедема. Поред капије се налазила улазна кула, изнутра правоугаоне, а споља заобљене основе. На очуваном делу јужног зидног платна и данас се виде ојачања – контрафори. Утврђењем још увек доминира снажна бранич-кула, такође издужене полукружне основе. Откопавањима, која су пре Другог светског рата вршена испред улазне куле, откривени су зидови који су опасивали подграђе.\nДанас је од града опстала само Донжон кула са нешто мало бедема и рушевином једне куле. Приликом истраживања самог локалитета, откривени су предмети из доба римске тетрархије и цара Проба (276—282) који је управљао делом Римског царства из Сирмијума, што указује да је првобитно утврђење на овом месту подигнуто још у његово доба као осматрачница или предстража самом Сирмијуму."},{id:20,name:"Споменик Слобода",position:[45.152786440028635,19.84008244402226],icon:"monument",image:"spomenik_sloboda",desc:"Споменик Слобода се налази на Иришком венцу, врху Фрушке горе. Подигнут је 1951. године у част палих бораца и представља симбол Народноослободилачке борбе народа Војводине. Свечано је отворен 7. јула 1951. године на десету годишњицу Дана устанка народа Србије. Аутор споменика је вајар Сретен Стојановић. Споменик се састоји од високог обелиска на чијем врху стоји жена-победа са високо уздигнутим рукама, гест којим позива народ на оружани устанак. На постољу из кога израста обелиск, налази се скулптура групе партизана. На бочним зидовима споменика налазе се бронзани рељефи са сценама из Народноослободилачке борбе."},{id:21,name:"Шатриначко Језеро",position:[45.086023514593315,19.918097073773357],icon:"lake",image:"satrinacko_jezero",desc:"Шатриначко језеро, познато и као Међаш или Међеш, језеро је смештено на око 5 километара од Ирига, а од Београда око 55 километара. Смештено на висини од 145 метара, Шатриначко језеро се налази ван заштитне зоне националног парка Фрушка Гора. Језеро је настало 1984. године преграђивањем истоименог потока и припада хидросистему Међаш — Јарчина — Галовица. Дужина бране износи 230, а висина 13,7 метара, док је само језеро дугачко 1.100 и широко око 350 метара. Протеже се на површини од 26 хектара, а има запремину од 1.500.000 кубних метара. Стране језера су мање-више голе и стрме, а на средини леве долинске стране се налази мања плажа са спортским тереном и угоститељским објектом."},{id:22,name:"Језеро Шелевренац",position:[45.0881461398503,19.981031837364288],icon:"lake",image:"jezero_selevrenac",desc:"Шеловренац (или Шелевренац) језеро је које се налази југозападно од Марадика. Од Београда је удаљено 55 km. Настало је 1985. године преграђивањем истоименог потока браном дужине 260, а висине 12,6 метара. Просечна дубина језера износи 2 метра. Шеловренац има површину од око 55 хектара, а запремину од 3.000.000 кубних метара."},{id:23,name:"Језеро Добродол",position:[45.06188913748015,19.944319997508803],icon:"lake",image:"jezero_dobrodol",desc:"Добродол је језеро смештено североисточно од истоименог села. Од Београда је удаљено око 50 километара. Настало је 1988. године изградњом бране на Банковачком потоку дужине 206 и висине 14 метара. Језеро захвата површину од 45 хектара, док му запремина износи 1.550.000 кубних метара. Обале језера су обрасле багремом, па су тешко присупачне. У близини језера Добродол налазе се православна црква Преображења Господњег и римокатоличка црква Светог Стјепана у Шатринцима, као и мала римокатоличка црква у Дорбинцима."}],n=i;exports.default=n;
